import React, { Component } from 'react';
import { ProgressBar } from 'react-bootstrap';


class Order extends React.Component{
    render(){
        const order = {
            id: "2y689",
            customer_name: "Herman Beck",
            status: "paid",
            price: 77.99,
            date: "May 15, 2015"
        }
        const table_content = () => {
            let content_list=[]
            for(let i=0;i<7;i++){
                content_list.push(
                    <tr>
                    <td className="py-1">
                      # {order.id}
                    </td>
                    <td> {order.customer_name} </td>
                    <td>
                      {order.status}
                    </td>
                    <td> $ {order.price} </td>
                    <td> {order.date} </td>
                  </tr>
                )
            }
            return content_list;
        }

        return (
            <>
              <div className="card">
              <div className="card-body">
                <h4 className="card-title">Striped Table</h4>
                <p className="card-description"> Add className <code>.table-striped</code>
                </p>
                <div className="table-responsive">
                  <table className="table table-striped">
                    <thead>
                      <tr>
                        <th> Order ID </th>
                        <th> Customer name </th>
                        <th> Status </th>
                        <th> Amount </th>
                        <th> Date </th>
                      </tr>
                    </thead>
                    <tbody>
                     {table_content()}
                    </tbody>
                  </table>
                </div>
              </div>
            </div>
            </>
        )}
}

export default Order
;
